import styled from 'styled-components';

export const Container = styled.div`
    display: flex;
    width: 100%;
    height: 100vh;
    background-color: blueviolet;
    justify-content: center;
    align-items: center;

    .Titulo{
        display: block;
        
    }

    button{
        display: block;
        align-items: center;
    }
`
